import { initialMembers } from "../App";
import Member from "./Member";

export default function membersList(){

    const members = initialMembers;

    return(
        <ul>
           {members.map((member, index) =>
           <Member
            member={member}
            key={index}
           /> 
        )} 
        </ul>
    )
}
